# O(1) space complexity and O(n^2) time complexity 

from typing import List

class Solution:
    def arrayPairSum(self, nums: List[int]) -> int:
        """
        When you have range(nums[:-1])) in the outer loop this  
        doesn't update with the new nums values............ but the
        inner loop does. This makes sense as a copy of nums would be 
        made at the start at each call.
        """
        acc = 0
        for i in range(len(nums[:-1])):
            min_val = nums[i]
            ind_swap2 = i
            # print(i, e_i)
            for j, e in enumerate(nums[i+1:]):

                j += i + 1
                if min_val > e: 
                    min_val = e
                    ind_swap2 = j
                    # print(min_val, j)
            if ind_swap2 != i:
                nums[i], nums[ind_swap2] = nums[ind_swap2], nums[i]

            if i % 2 == 0:
                # print(min_val, nums, i)
                acc += min_val
            print(nums)
        return acc

